CREATE SEQUENCE "countries_country_id_seq"
    INCREMENT 1  MINVALUE 1
    MAXVALUE 32767  START 1
    CACHE 1;

CREATE SEQUENCE "regions_region_id_seq"
    INCREMENT 1  MINVALUE 1
    MAXVALUE 32767  START 1
    CACHE 1;

CREATE SEQUENCE "cities_city_id_seq"
    INCREMENT 1  MINVALUE 1
    MAXVALUE 32767  START 1
    CACHE 1;

CREATE TABLE token_countries (
    country_id smallint DEFAULT nextval('countries_country_id_seq'::regclass) NOT NULL,
    title character varying NOT NULL
) WITHOUT OIDS;

CREATE TABLE token_regions (
    region_id smallint DEFAULT nextval('regions_region_id_seq'::regclass) NOT NULL,
    country_id smallint NOT NULL,
    title character varying NOT NULL
) WITHOUT OIDS;

CREATE TABLE token_locations (
    city_id smallint DEFAULT nextval('cities_city_id_seq'::regclass) NOT NULL,
    region_id smallint NOT NULL,
    country_id smallint NOT NULL,
    title character varying
) WITHOUT OIDS;

























ALTER TABLE ONLY token_countries
    ADD CONSTRAINT token_countries_pkey PRIMARY KEY (country_id);

ALTER TABLE ONLY token_regions
    ADD CONSTRAINT token_regions_fk FOREIGN KEY (country_id) REFERENCES token_countries(country_id) ON UPDATE CASCADE ON DELETE CASCADE;

ALTER TABLE ONLY token_regions
    ADD CONSTRAINT token_regions_pkey PRIMARY KEY (region_id);

ALTER TABLE ONLY  token_locations
    ADD CONSTRAINT  token_locations_fk FOREIGN KEY (country_id) REFERENCES token_countries(country_id) ON UPDATE CASCADE ON DELETE CASCADE;

ALTER TABLE ONLY  token_locations
    ADD CONSTRAINT  token_locations_fk1 FOREIGN KEY (region_id) REFERENCES token_regions(region_id) ON UPDATE CASCADE ON DELETE CASCADE;

ALTER TABLE ONLY  token_locations
    ADD CONSTRAINT  token_locations_pkey PRIMARY KEY (city_id);
